import React from 'react';
import styles from './Search.module.css';

const Search = () => {
  return (
    <div>
      <form>
        <input/>
        <div>
          <button className={styles.searchButton} type='submit'/>
        </div>
      </form>
    </div>
  );
}

export default Search;
